-- ----------------------------
-- Procedure structure for codproductos
-- ----------------------------
DROP PROCEDURE IF EXISTS `codproductos`;
DELIMITER ;;
CREATE  PROCEDURE `codproductos`()
BEGIN
declare cod char(10);
declare n int;
declare vusu char(5);

				    if(select count(*)from producto)=0 then
               set n=0;
            else
                set n=(select max(right(id_producto,2))from producto);
            end if;
             set cod=concat('PR',right(concat('000000',n+1),7));


          select cod;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_actualizarexistencia
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_actualizarexistencia`;
DELIMITER ;;
CREATE  PROCEDURE `sp_actualizarexistencia`(IN `vid` BIGINT(20), IN `vcant` DOUBLE)
BEGIN
DECLARE ncant double;
DECLARE cantbd DOUBLE;

select stock into cantbd from producto WHERE id_producto=vid;
set ncant= cantbd + vcant;
UPDATE producto set stock=ncant where id_producto = vid;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_insertarcompra
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_insertarcompra`;
DELIMITER ;;
CREATE  PROCEDURE `sp_insertarcompra`(IN vcomprobante BIGINT,
IN vfecha DATE,
IN vtotal double,
In vserie VARCHAR(20),
IN vnumero VARCHAR(20),
IN vidproveedor BIGINT

)
BEGIN

INSERT INTO compra(comprobante,fecha,total,serie,numero,id_proveedor)
VALUES(vcomprobante,vfecha,vtotal,vserie,vnumero,vidproveedor);

select LAST_INSERT_ID();
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_insertardetalle
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_insertardetalle`;
DELIMITER ;;
CREATE  PROCEDURE `sp_insertardetalle`(IN `vidproducto` BIGINT,
 IN `vprecio` DOUBLE,
 IN `vcantidad` DOUBLE,
 IN `viddoc` BIGINT,
IN vcodigo VARCHAR(20),
IN vdescrip VARCHAR(500))
BEGIN
 
declare cantbd double;
declare ncant double;
declare vfactor double;

SELECT stock into cantbd from producto where id_producto = vidproducto;
SELECT factor into vfactor from producto where id_producto = vidproducto;
set ncant = cantbd - (vcantidad/vfactor);

update producto set stock= ncant where id_producto=vidproducto;

insert into detalle(id_producto,precio,cantidad,id_documento,codigo,descripcion) 
values(vidproducto,vprecio,vcantidad,viddoc,vcodigo,vdescrip);

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_insertardocumento
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_insertardocumento`;
DELIMITER ;;
CREATE  PROCEDURE `sp_insertardocumento`(IN vidmovimiento BIGINT,
IN vidcliente BIGINT,
IN viddoctor BIGINT,
In vidarea BIGINT,
IN viduser BIGINT,
IN vcomprobante BIGINT

)
BEGIN

INSERT INTO documento(id_movimiento ,id_cliente,iddoctor,idarea,fecha,id_usuario,comprobante)
VALUES(vidmovimiento,vidcliente,viddoctor,vidarea,CURRENT_DATE(),viduser,vcomprobante);

select LAST_INSERT_ID();
END
;;
DELIMITER ;

