DROP PROCEDURE IF EXISTS `sp_insertarhistorial`;
DELIMITER ;;
CREATE  PROCEDURE `sp_insertarhistorial`(IN `viddoctor` BIGINT,
 IN `vidmascota` BIGINT, 
IN `vfecha` DATETIME, 
IN `vfc` VARCHAR(20), 
IN `vfr` VARCHAR(20), 
IN `vp` VARCHAR(20), 
IN `vpam` VARCHAR(20), 
IN `vps` VARCHAR(20), 
IN `vpd` VARCHAR(20), 
IN `vd` VARCHAR(20), 
IN `vcpp` VARCHAR(20),
IN tempe VARCHAR(20),
IN descrip VARCHAR(500),
IN vdiagnostico VARCHAR(500),
IN vtratamiento VARCHAR(500),
IN observa VARCHAR(500),
IN consulta DOUBLE,
IN tratamientoc DOUBLE,
IN analisis DOUBLE,
IN vacuna DOUBLE,
IN servicios DOUBLE,
IN analisisfot LONGBLOB,
IN vcirujia DOUBLE,
IN vinternado DOUBLE)
BEGIN
          INSERT INTO historialmedico(iddoctor,id_mascota,horaatendio,fc ,fr,p,pam,ps,pd,d,cpp,facturado,temperatura,
descripcion,diagnostico,tratamiento,observacion,consultacosto,tratamientocosto,analisiscosto,vacunacosto,serviciosveterinariocosto,analisisfoto,
cirujiacosto,internadocosto)
  VALUES (viddoctor,vidmascota,vfecha,vfc,vfr,vp,vpam,vps,vpd,vd,vcpp,FALSE,tempe,descrip,vdiagnostico,vtratamiento,
observa,consulta,tratamientoc,analisis,vacuna,servicios,analisisfot,vcirujia,vinternado);

select LAST_INSERT_ID();
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_insertlote
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_insertlote`;
DELIMITER ;;
CREATE  PROCEDURE `sp_insertlote`(IN `vfechaexp` DATE, IN `vfechafa` DATE, IN `vnlote` VARCHAR(50), IN `vrs` VARCHAR(50), IN `vcant` DOUBLE, IN `idprod` BIGINT)
BEGIN
DECLARE cantbd DOUBLE;
DECLARE ncant DOUBLE;
	SELECT
		stock INTO cantbd
	FROM
		producto
	WHERE
		id_producto = idprod ;

	SET ncant = cantbd + vcant ;

 UPDATE producto
	SET stock = ncant,fechaexp=vfechaexp,fechafab=vfechafa,nlote=vnlote,rs=vrs
	WHERE
		id_producto = idprod ; 



END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for sp_modiproductos
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_modiproductos`;
DELIMITER ;;
CREATE  PROCEDURE `sp_modiproductos`(`id` CHAR(5), `des` VARCHAR(200), `pre` DOUBLE(10,2), `sto` INT, `acti` INT, `ob` VARCHAR(250))
BEGIN
UPDATE producto set descripcion=des,precio=pre,stock=sto,activo=acti,observacion=ob where id_producto=id;
END
;;
DELIMITER ;
